def calculate_impact(time_m,category,activity):
    time_h = time_m/60
    df = conversion_dict.loc[category,activity]
    if category == 'THERMAL':
        ac_consumption = df.loc['ac_consumption'].values[0]
        energy_price = df.loc['energy_price'].values[0]
        energy_ef = df.loc['energy_ef'].values[0]
        
        energy = time_h * ac_consumption
        money = energy * energy_price
        emissions = energy * energy_ef
    elif category == 'KINETIC':
        speed = df.loc['speed'].values[0]
        prt_ec = df.loc['prt_ec'].values[0]
        prt_fuel_pr = df.loc['prt_fuel_pr'].values[0]
        prt_fuel_aut = df.loc['prt_fuel_aut'].values[0]
        prt_ef = df.loc['prt_ef'].values[0]
        
        distance = time_h * speed
        energy = distance * prt_ec
        money = distance * prt_fuel_pr * prt_fuel_aut
        emissions = distance * prt_ef
    elif category == 'ELECTRIC':
        avg_sun_irr = df.loc['avg_sun_irr'].values[0]
        pv_area = df.loc['pv_area'].values[0]
        energy_price = df.loc['energy_price'].values[0]
        energy_ef = df.loc['energy_ef'].values[0]
        
        energy = time_h * avg_sun_irr * pv_area
        money = energy * energy_price
        emissions = energy * energy_ef
    elif category == 'BIOCHEMICAL':
        en_burnt = df.loc['en_burnt'].values[0]
        gym_ec = df.loc['gym_ec'].values[0]
        energy_ef = df.loc['energy_ef'].values[0]
        
        energy = time_h * en_burnt
        money = None
        emissions = time_h * gym_ec * energy_ef
    
    return energy, money, emissions

def generate_labels(category, variable, value):
    if variable == 'emissions':
        label = '{:,.2f} kg of CO2 avoided'.format(value)
    else:
        if category == 'THERMAL':
            if variable == 'energy':
                label = '{:,.2f} kWh of A/C saved'.format(value)
            elif variable == 'money':
                label = '€ {:,.2f} saved in household energy'.format(value)
        elif category == 'KINETIC':
            if variable == 'energy':
                label = '{:,.2f} kWh saved from private vehicles energy consumption'.format(value)
            elif variable == 'money':
                label = '€ {:,.2f} saved in fuel consumption'.format(value)
        elif category == 'ELECTRIC':
            if variable == 'energy':
                label = '{:,.2f} kWh saved from energy grid'.format(value)
            elif variable == 'money':
                label = '€ {:,.2f} saved in household energy'.format(value)
        elif category == 'BIOCHEMICAL':
            if variable == 'energy':
                label = '{:,.2f} kWh burnt as calories'.format(value)
            else:
                label = None
    return label

def add_register(metadata, category, activity, time_m):
    global CARBON_CREDITS
    
    energy, money, emissions = calculate_impact(time_m, category, activity)
    
    new_row = {'timestamp': time.time(),
               'category': category,
               'activity': activity,
               'time': time_m,
               'energy': energy,
               'money': money,
               'emissions': emissions}
    
    new_row = pd.DataFrame.from_dict([new_row])

    # Append the new row to the DataFrame
    metadata = pd.concat([metadata,new_row],ignore_index=True,axis=0)
    new_carbon_credits = round(emissions/1000,2)
    CARBON_CREDITS += new_carbon_credits
    prin_msg = f"""
    SUMMARY:/n
    /n
    {time_m} minutes of {activity}/n
     /n
    {generate_labels(category, 'energy', energy)}/n
    {generate_labels(category, 'money', money) if category != 'BIOCHEMICAL' else ''}/n
    {generate_labels(category, 'emissions', emissions)}/n
     /n
    You gained {new_carbon_credits} Carbon Credits
    """

    return metadata, prin_msg

def create_chart(metadata):
    agg_df = metadata.groupby(
        ['category','activity']
    )[['energy', 'money', 'emissions']].sum().reset_index().rename(columns={'activity':'Activity'})

    if len(agg_df)==0:
        li = []
        for category in ['THERMAL', 'KINETIC', 'ELECTRIC', 'BIOCHEMICAL']:
            li.append({
                'category':category,
                'Activity':'',
                'energy':0,
                'money':0,
                'emissions':0
            })
        agg_df = pd.DataFrame.from_dict(li)

    for col in ['energy', 'money', 'emissions']:
        agg_df[col.capitalize()] = agg_df.apply(lambda row: generate_labels(row['category'],col,row[col]),axis=1)

    category_order = ['THERMAL', 'KINETIC', 'ELECTRIC', 'BIOCHEMICAL']

    fig = px.bar(
        agg_df,
        y='category',x='energy',
        orientation='h',
        color='category',
        hover_data=[st.capitalize() for st in ['activity','energy', 'money', 'emissions']],
        category_orders = {'category':category_order},
        color_discrete_map=colors,
        labels={'category':'Category','energy':'Energy'},
    )

    fig.update_layout(
        xaxis_visible=False,
    #     yaxis_visible=False,
        plot_bgcolor='rgba(0,0,0,0)',  # Set background color to transparent
        paper_bgcolor='rgba(0,0,0,0)',
        showlegend=False,  # Remove legend
        yaxis=dict(
            title=dict(
                text='Energy Category',
                font=dict(
                    family='Montserrat',  # Change font family
                    color='white'  # Change font color
                )
            ),
            tickfont=dict(
                family='Montserrat',  # Change font family
                color='white'  # Change font color
            )
        ),
        modebar=dict(
            bgcolor = 'rgba(0,0,0,0)',
            remove=["autoScale2d", "autoscale", "editInChartStudio", "editinchartstudio", "hoverCompareCartesian", "hovercompare", "lasso", "lasso2d", "orbitRotation", "orbitrotation", "pan", "pan2d", "pan3d", "reset", "resetCameraDefault3d", "resetCameraLastSave3d", "resetGeo", "resetSankeyGroup", "resetScale2d", "resetViewMapbox", "resetViews", "resetcameradefault", "resetcameralastsave", "resetsankeygroup", "resetscale", "resetview", "resetviews", "select", "select2d", "sendDataToCloud", "senddatatocloud", "tableRotation", "tablerotation", "toImage", "toggleHover", "toggleSpikelines", "togglehover", "togglespikelines", "toimage", "zoom", "zoom2d", "zoom3d", "zoomIn2d", "zoomInGeo", "zoomInMapbox", "zoomOut2d", "zoomOutGeo", "zoomOutMapbox", "zoomin", "zoomout"]# Hide the modebar which includes zoom and pan buttons
        ),
        margin=dict(pad=0,b=0,l=0,r=0,t=10)
    )

    fig.update_traces(marker_line_color='#000000', marker_line_width=1.5)
    
    return fig


