def toggle_modal_success(n1, n2, is_open,activity,time_m):
    global metadata
    if activity:
        category = act_cat_dict[activity]
        metadata, print_msg = add_register(metadata, category, activity, time_m)
        print_msg = [dbc.Row(html.Span(line)) for line in print_msg.split('/n')]
    else:
        print_msg = ''
    if n1 or n2:
        return not is_open, print_msg, '{:,.1f}'.format(CARBON_CREDITS), create_chart(metadata)
    return is_open, print_msg, '{:,.1f}'.format(CARBON_CREDITS), create_chart(metadata)

